// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract BomToken {
   string name       = "BombToken" ;
   string symbole    = "BT";
   uint256 csupply    =   9000000;
   uint256 maxSupply   = 100000000;
   uint256 decimal  = 10;

   address owner;


   mapping(address => address ) public transaction;

   mapping(address => uint256 ) ledger;

   mapping(address => address ) public trust;

   constructor() {
         owner   = msg.sender ;
    } 

  
     modifier OnlyOwner{
        require(msg.sender == owner);_;
    }



    function getBalance(address targetwallet) public view returns(uint256)
    {
        return ledger[targetwallet];

    }


    function mint(uint256 amount ,address targetAdress) public {
             require( amount+csupply <= maxSupply , "error not enough supply");
             ledger[targetAdress] += amount;
             csupply += amount;
    }

    function burn(uint256 _amount) public {
        ledger[msg.sender] -= _amount;
             csupply -= _amount;
    }

    function approve (address _trusty) public {
        trust[msg.sender] = _trusty;
    }




    // function tranfer (address _target, uint256 _balance ) public {
    //     uint256 targetBalance
    //     transaction[wallet] = _target ;
    //     balance[wallet] = _balance;
    
    // }





   



}

